  `fecha` date DEFAULT NULL,
  `importe` float DEFAULT NULL,
  `idPropiedad` int(200) DEFAULT NULL,
  `idEntidad` int(11) DEFAULT NULL,
  `estado` varchar(255) DEFAULT NULL,
  `idTipoParaCobrar` int(5) DEFAULT NULL,
