INSERT INTO `plantillas` VALUES (4,'<table cellspacing=\"2\" cellpadding=\"2\" border=\"0\" width=\"100%\" height=\"4\" style=\"text-align: left;\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"vertical-align: top;\">\r\n            <p><strong>Asociaci&oacute;n Austral de oftalmolog&iacute;a</strong></p>\r\n            <div><i><span style=\"font-size: 7.5pt;\">Sargento Ramirez 2177&nbsp;</span></i></div>\r\n            <div><i><span style=\"font-size: 7.5pt;\">Tel. 0297-154205636</span></i> <i><span style=\"font-size: 7.5pt;\"> </span></i></div>\r\n            <div><i><span style=\"font-size: 7.5pt;\">Comodoro Rivadavia</span></i></div>\r\n            <div>&nbsp;</div>\r\n            </td>\r\n            <td style=\"vertical-align: top;\">&nbsp;<img align=\"right\" width=\"107\" height=\"78\" src=\"http://gsofter.com/desarrollo/plataformaYii/practicas/images/logo.jpg\" alt=\"\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>','html','Cabezal','CABEZAL'),(5,'<div class=\"impresionPapel\" id=\"impresionPapel\">\r\n<div class=\"imprimir\">\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:160px\">\r\n			<h3>%logo</h3>\r\n			</td>\r\n			<td>\r\n			<div>\r\n			<h3>%edificio</h3>\r\n			</div>\r\n\r\n			<div>%direccion&nbsp;<strong>CUIT</strong>&nbsp;%cuit</div>\r\n			Resumen de expensas de<strong><span style=\"font-size:14px\">&nbsp;%mes %ano</span></strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\"><small>%expensas</small></td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">%morosos</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<div style=\"line-height: 20.7999992370605px;\">%pago</div>\r\n\r\n			<div style=\"line-height: 20.7999992370605px;\">Para comunicarse ante cualquier duda&nbsp;<strong>%telefonos</strong></div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n','html','Expensas','EXPENSAS'),(6,'<div class=\"impresionPapel\" id=\"impresionPapel\">\r\n<div class=\"imprimir\">\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<h1><strong>%logo</strong></h1>\r\n			</td>\r\n			<td>\r\n			<div style=\"line-height: 20.7999992370605px;\"><strong>%edificio&nbsp;</strong></div>\r\n\r\n			<div style=\"line-height: 20.7999992370605px;\"><strong>CONSORCIO DE EDIFICIOS</strong></div>\r\n\r\n			<div style=\"line-height: 20.7999992370605px;\"><tt><var>%direccion&nbsp;<strong>CUIT</strong>&nbsp;%cuit</var></tt></div>\r\n\r\n			<address>\r\n			<address><var>Resumen de expensas de<strong><span style=\"font-size:14px\">&nbsp;%mes %ano</span></strong></var></address>\r\n			</address>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<h3><strong>GASTOS ORDINARIOS</strong></h3>\r\n\r\n			<p>%gastosOrdinarios</p>\r\n\r\n			<h3><strong>GASTOS EXTRAORDINARIOS</strong></h3>\r\n\r\n			<p>%gastosExtraordinarios</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<p><strong>%lugarPago</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n','','Detalle Gastos Expensas','GASTOS_EXP'),(7,'<div class=\"impresionPapel\" id=\"impresionPapel\">\r\n<div class=\"imprimir\">\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"height:50px; line-height:20.7999992370605px; width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:right\">&nbsp;</td>\r\n			<td style=\"text-align:right; width:50px\"><strong><span style=\"font-size:48px\">&nbsp;%letra&nbsp;</span></strong></td>\r\n			<td style=\"text-align:right\">\r\n			<div style=\"line-height: 20.7999992370605px; text-align: right;\">&nbsp;</div>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table border=\"1\" cellpadding=\"10\" cellspacing=\"0\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:left; vertical-align:top; width:600px\">\r\n			<div><span style=\"font-size:24px\"><strong>%razonSocial_emisor</strong></span></div>\r\n\r\n			<div><span style=\"font-size:12px\"><strong>%condicionIva_emisor</strong></span></div>\r\n\r\n			<div>%direccion_emisor</div>\r\n\r\n			<div>CUIT: %cuit_emisor</div>\r\n\r\n			<div>%email_emisor</div>\r\n			</td>\r\n			<td style=\"text-align:right; vertical-align:top; width:600px\">\r\n			<div>\r\n			<div style=\"line-height: 20.7999992370605px; text-align: right;\"><em>Nro&nbsp;%nroComprobante</em></div>\r\n\r\n			<div style=\"line-height: 20.7999992370605px; text-align: right;\"><span style=\"font-size:14px\">%fecha</span></div>\r\n			</div>\r\n\r\n			<div><span style=\"font-size:16px\"><strong>A %razonSocial_receptor</strong></span></div>\r\n\r\n			<div><span style=\"font-size:12px\"><strong>%condicionIva_receptor</strong></span></div>\r\n\r\n			<div>%direccion_receptor</div>\r\n\r\n			<div><strong>CUIT:</strong> %cuit_receptor</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td colspan=\"2\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>%detallePago</p>\r\n\r\n						<div>_________________________</div>\r\n\r\n						<div>Responsable de Cobro</div>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"text-align:right\">dd</p>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<p style=\"text-align:right\">&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n','html','Recibo','COMPROBANTE'),(8,'<h3>Disculpas, no hay impresi&oacute;n para este comprobante.</h3>\r\n\r\n<p>Debes agregar una plantilla desde Plantillas/nuevo y luego desde Comprobantes/Tipos editar el comprobante y asignarle la plantilla anteriormente creada.</p>\r\n','','Sin Impresion','SINIMPRES'),(9,'<p style=\"text-align:justify\"><span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">En la ciudad de <strong>%ciudadEmpresa&nbsp;</strong>, a los <strong>%diaActual&nbsp;</strong>d&iacute;as del mes de<strong> %mesActual</strong> de <strong>%anoActual</strong>, las partes: el Sr. <strong>%nombreLocador </strong>(DNI <strong>%dniLocador</strong>), con domicilio en la calle <strong>%domicilioLocador</strong>, por una parte; en adelante denominada la LOCADORA: y el Sr. <strong>%nombreLocatario</strong>&nbsp;(DNI <strong>%dniLocatario</strong>) , con domicilio en la calle <strong>%domicilioLocatario</strong>, de la localidad de <strong>%localidadLocatario</strong>, Pcia. <strong>%provinciaLocatario&nbsp;</strong>, por la otra parte, llamada en adelante la LOCATARIA, celebran este contrato de locaci&oacute;n que se regir&aacute; por las siguientes cl&aacute;usulas y condiciones pactadas de com&uacute;n acuerdo:- PRIMERA: La LOCADORA entrega en locaci&oacute;n un inmueble sito en la calle <strong>%domicilioPropiedad</strong>&nbsp;, Pcia.<strong>%provinciaPropiedad</strong> La LOCATARIA lo recibe a su entera satisfacci&oacute;n, en perfectas condiciones de conservaci&oacute;n y uso, y se obliga a mantener la unidad locada, sus instalaciones y los bienes recibidos en las mismas condiciones en que se encuentra hasta su restituci&oacute;n a la LOCADORA, salvo el desgaste producido por el buen uso y el transcurso del tiempo, los gastos de mantenimiento y reparaci&oacute;n del inmueble estar&aacute;n a cargo exclusivo de la LOCATARIA. -&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">SEGUNDA: La LOCATARIA destinar&aacute; el inmueble locado exclusivamente para vivienda propia, quedando prohibido darle otro destino. La LOCADORA por si o por intermedio de quien la represente tendr&aacute; libre acceso a cualquier dependencia, del &aacute;mbito locado cuando juzgue necesaria su inspecci&oacute;n, previo aviso con antelaci&oacute;n de veinticuatro horas a la LOCATARIA.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">TERCERA: El presente contrato se formaliza por el t&eacute;rmino improrrogable de <strong>%mesesContrato</strong> (<strong>%mesesLetraContrato</strong>) meses a partir del d&iacute;a <strong>%diaInicioContrato </strong>de <strong>%mesInicioContrato</strong> de <strong>%anoInicioContrato </strong>y su vencimiento tendr&aacute; lugar el d&iacute;a <strong>%diaVtoContrato&nbsp;</strong>de <strong>%mesVtoContrato</strong> de<strong> %anoVtoContrato</strong>&nbsp;en cuya fecha la LOCATARIA deber&aacute; restituir el inmueble totalmente desocupado a la LOCADORA. La LOCATARIA renuncia expresamente a toda pr&oacute;rroga que pudiera acordarle las leyes dictadas o por dictarse.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">CUARTA: El importe inicial de la locaci&oacute;n se fija en la suma mensual de Pesos <strong>%importeLetrasContrato </strong>($ <strong>%importeContrato</strong>&nbsp;.-) por mensualidades enteras no fraccionadas. El monto del alquiler antes mencionado ser&aacute; percibido por la LOCADORA libre de toda retenci&oacute;n, gastos, impuestos, tasas o tributos actuales y/o futuros. Las partes declaran que han negociado los t&eacute;rminos de este contrato con la m&aacute;s absoluta buena fe y expresan su voluntad de no perjudicar de manera absoluta los intereses de la otra, asimismo renuncian a ampararse en cualquier resoluci&oacute;n que se dictare, que implique obligar abusivamente a cualquiera de las partes. Con relaci&oacute;n al valor locativo las partes declaran que lo han fijado de acuerdo con las particulares circunstancias actuales derivadas de la incertidumbre existente en los mercados y de la sanci&oacute;n de la Ley 25.561 (Ley de Emergencia P&uacute;blica y de Reforma del R&eacute;gimen Cambiario) siendo su intenci&oacute;n fijar un precio justo y adecuado a los valores de plaza. En funci&oacute;n de ello y pasados seis meses de suscrito el contrato, si alguna de las partes considerara que el precio ha quedado desactualizado lo har&aacute; saber a la otra en forma fehaciente, fijando el nuevo precio. En cinco (5) d&iacute;as deber&aacute; estar fijado de com&uacute;n acuerdo. En caso de que en el plazo estipulado no haya acuerdo, cada parte designar&aacute; un &aacute;rbitro arbitrador. En diez (10) d&iacute;as deber&aacute;n fijar el nuevo precio el que ser&aacute; obligatorio si no es objetado por las partes dentro de las 48 horas de ser notificadas. En caso de no haber acuerdo entre los &aacute;rbitros, los mismos deber&aacute;n designar un tercero que fijar&aacute; el precio fundando su decisi&oacute;n y notific&aacute;ndolo a las partes. Su decisi&oacute;n ser&aacute; obligatoria para las partes, y solo recurrible ante la justicia y solamente en cuanto al monto, fij&aacute;ndolo los tribunales por peritos oficiales. Los gastos que genere la actualizaci&oacute;n del valor locativo se repartir&aacute;n por mitades entre las partes.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">QUINTA: El alquiler ser&aacute; pagado por adelantado, dentro de los cinco primeros d&iacute;as h&aacute;biles de cada mes, en el domicilio de la LOCADORA, o en cualquier otro que &eacute;sta indique en el futuro.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">SEXTA: La LOCATARIA se obliga a pagar los servicios de luz, gas natural, agua corriente, la tasa municipal por alumbrado y conservaci&oacute;n de la v&iacute;a p&uacute;blica de la Municipalidad de <strong>%localidadEmpresa</strong>, expensas comunes y el servicio telef&oacute;nico correspondiente al n&uacute;mero<strong> %telefonoEmpresa</strong>. Tomando a su cargo la LOCADORA: y el impuesto inmobiliario de la Pcia. <strong>%provinciaEmpresa</strong>. La LOCATARIA deber&aacute; poner a su nombre los servicios y entregar a la LOCADORA los recibos de impuestos, servicios y expensas que acrediten los pagos realizados en t&eacute;rmino junto con el pago del alquiler. -&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">S&Eacute;PTIMA: Queda prohibido a la LOCATARIA: a) Introducir modificaciones o cambios en la estructura e instalaciones del inmueble; en caso de introducir modificaciones al inmueble locado la LOCATARIA deber&aacute; pedir autorizaci&oacute;n por escrito a la LOCADORA, quedando todas las mejoras en beneficio de la LOCADORA, sin que ello signifique pago o indemnizaci&oacute;n alguna en favor de la LOCATARIA, b) Subarrendar o dar en uso total o parcial del inmueble, ceder o transferir la locaci&oacute;n. La LOCADORA no se responsabiliza por vicios redhibitorios, accidentes, casos fortuitos, incendios o cualquier otro siniestro.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">OCTAVA: Se pacta con el car&aacute;cter de cl&aacute;usula penal: a) Que el pago del alquiler despu&eacute;s de vencido el plazo de 5 d&iacute;as devengar&aacute; a favor de la LOCADORA un punitorio diario del 1% por cada d&iacute;a de mora y la LOCADORA podr&aacute; negarse a percibir el alquiler sin el pago conjunto de los importes devengados por este concepto. b) Que si al vencimiento del plazo contractual la LOCATARIA no restituye el inmueble, deber&aacute; pagar a la LOCADORA, adem&aacute;s del alquiler mensual vigente, un punitorio diario del 0,5 % (cero coma cinco por ciento) por cada d&iacute;a de demora, sin perjuicio del derecho de la LOCADORA a exigir, en cualquier momento, la restituci&oacute;n del inmueble. c) Que si por falta de pago de los abonos y consumos correspondientes se diera de baja el servicio telef&oacute;nico, la LOCATARIA deber&aacute; asumir la reposici&oacute;n y todos los costos de una l&iacute;nea nueva seg&uacute;n valor de tarifa de la compa&ntilde;&iacute;a telef&oacute;nica correspondiente al momento que esto se produzca m&aacute;s los costos de rehabilitaci&oacute;n del servicio, en concepto de indemnizaci&oacute;n La LOCADORA podr&aacute; demandar por juicio ejecutivo el pago del alquiler, las deudas por reparaciones de deterioros, las mencionadas en esta cl&aacute;usula, las establecidas en la estipulaci&oacute;n sexta y cualquier otra deuda derivada de la locaci&oacute;n. La falta de cumplimiento de cualquiera de las obligaciones del pago de los servicios de la LOCATARIA y en especial la falta de pago de dos (2) meses de alquiler, facultar&aacute; a la LOCADORA para demandar judicialmente el desalojo y ejercer cualquier otra acci&oacute;n a que se considere con derecho, corriendo por cuenta de la LOCATARIA las costas, gastos y honorarios extra y/o judiciales que el cumplimiento del contrato ocasione.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">NOVENA: En todos los casos la mora se producir&aacute; en forma autom&aacute;tica por el s&oacute;lo vencimiento del plazo, sin necesidad de interpelaci&oacute;n alguna.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">D&Eacute;CIMA: El&nbsp;Sr.&nbsp;</span><strong>%nombreLocatario</strong><span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">&nbsp;(DNI&nbsp;</span><strong>%dniLocatario</strong><span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">) , con domicilio en la calle&nbsp;</span><strong>%domicilioLocatario</strong><span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">, de la localidad de&nbsp;</span><strong>%localidadLocatario</strong><span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">, Pcia.&nbsp;</span><strong>%provinciaLocatario&nbsp;</strong><span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">, se constituye en codeudor solidario y principal pagador, con expresa renuncia a los beneficios de divisi&oacute;n y excusi&oacute;n, de todas y cada una de las obligaciones de la LOCATARIA, incluyendo los gastos, costas y honorarios de cualquier demanda judicial en la que la LOCATARIA sea condenada en costas. Esta garant&iacute;a se mantendr&aacute; vigente por todo el tiempo que dure la ocupaci&oacute;n del inmueble y hasta la expiraci&oacute;n de todas las obligaciones de este contrato por parte de la LOCATARIA. El codeudor manifiesta y acredita mediante la exhibici&oacute;n del correspondiente t&iacute;tulo de propiedad, ser propietario del inmueble sito en la calle <strong>%domicilioPropiedad</strong>, de la localidad de <strong>%localidadPropiedad</strong>,&nbsp;y sin perjuicio de las obligaciones que contrae con todo su patrimonio, se obliga a no enajenarlo ni gravarlo mientras dure la obligaci&oacute;n asumida en este acto en raz&oacute;n de haber sido tenido en cuenta para la aceptaci&oacute;n de la garant&iacute;a, en caso de venta presentar&aacute; nuevos bienes inmuebles a total satisfacci&oacute;n de la LOCADORA.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">DECIMAPRIMERA: La LOCATARIA entrega en este acto a la LOCADORA la suma de Pesos <strong>%importeContrato</strong>&nbsp;($ <strong>%importeLetrasContrato</strong>&nbsp;.-), en concepto de dep&oacute;sito de garant&iacute;a del presente contrato de locaci&oacute;n, sirviendo el presente de suficiente y formal recibo. Este importe no podr&aacute; aplicarse al pago de alquileres ni devengara intereses y le ser&aacute; devuelto a la LOCATARIA una vez de haber liquidado la LOCADORA todas las facturas de impuestos, servicios y expensas correspondientes hasta el &uacute;ltimo d&iacute;a de ocupaci&oacute;n del bien locado.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">DECIMASEGUNDA: Para la restituci&oacute;n de la tenencia del inmueble la LOCATARIA deber&aacute; notificar fehacientemente a la LOCADORA, con una anticipaci&oacute;n no menor a los 60 d&iacute;as; debiendo a su vez la LOCATARIA permitir a la LOCADORA con 30 d&iacute;as de anticipaci&oacute;n de la entrega del bien locado las visitas necesarias para comercializar el inmueble objeto del presente contrato. Si por cualquier motivo la LOCATARIA deposita judicialmente las llaves, se considerara para todos los efectos legales, que la LOCADORA recupera la tenencia en el momento en que se de judicialmente la efectiva posesi&oacute;n del inmueble locado, quedando a salvo los derechos de &eacute;sta para exigir en cualquier momento el resarcimiento de da&ntilde;os y perjuicios. La entrega de las llaves y la restituci&oacute;n del inmueble deber&aacute; acreditarla la LOCATARIA mediante documento emanado de la LOCADORA, no admiti&eacute;ndose otro medio de prueba.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">DECIMATERCERA: La LOCATARIA renuncia expresamente a la facultad de recusar al juez sin expresi&oacute;n de causa.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">DECIMACUARTA: Los firmantes se someten a las disposiciones del C&oacute;digo Civil ley supletoria en todo lo que no hubiesen pactado expresamente y a la competencia de los Tribunales Ordinarios de <strong>%ciudadEmpresa</strong>. Constituyendo las partes domicilios especiales indicados Ut-Supra donde se tendr&aacute;n por v&aacute;lidas todas las notificaciones all&iacute; cursadas, judiciales y extrajudiciales.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">DECIMAQUINTA: CONVENIO DE DESOCUPACI&Oacute;N: Las partes pactan expresamente que la LOCATARIA est&aacute; obligada a entregar el inmueble totalmente desocupado y libre de efectos en la fecha de vencimiento de este contrato o en el caso que dejase de abonar dos (2) meses de alquiler consecutivos o los servicios e impuestos, revistiendo el presente acuerdo el car&aacute;cter de Convenio de Desocupaci&oacute;n pudiendo una de las partes solicitar la homologaci&oacute;n judicial a su costa del presente convenio, de forma tal que una vez homologado revista el car&aacute;cter de sentencia firme de desalojo, pudiendo ejecutar la misma y proceder al lanzamiento por el procedimiento de ejecuci&oacute;n de sentencia.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">DECIMASEXTA: Si por cualquier circunstancia f&aacute;ctica, jur&iacute;dica o pol&iacute;tica se modificase la Ley 25.561 de Emergencia P&uacute;blica y de Reforma del R&eacute;gimen Cambiario, con relaci&oacute;n a la posibilidad de ajustar los valores de alquiler, las partes convienen aplicar el sistema de ajuste que se promulgue oficialmente.-&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,verdana,arial; font-size:11px\">De conformidad se firman tres (3) ejemplares para cada una de las partes intervinientes de un mismo tenor y a un solo efecto.-&nbsp;</span></p>\r\n','','CONTRATO','CONTRATO');
