INSERT INTO `settings` VALUES (1,'impresiones','ORDEN_TRABAJO','<p><strong><span style=\"font-size: xx-large;\">FOXIS</span></strong></p>\r\n<div><strong><span style=\"font-size: small; \">ORDEN DE TRABAJO</span></strong></div>\r\n<div><strong><span style=\"font-size: xx-small; \">FECHA:</span></strong><span style=\"font-size: xx-small; \"> %fechaOrden</span></div>\r\n<div><strong><span style=\"font-size: xx-small; \">PRIORIDAD: </span></strong><span style=\"font-size: xx-small; \">%prioridad</span></div>\r\n<div><strong><span style=\"font-size: xx-small; \">NRO ORDEN: %nroOrden</span></strong></div>\r\n<div><strong><span style=\"font-size: xx-small; \">CLIENTE:</span></strong><span style=\"font-size: xx-small; \"> %cliente</span></div>\r\n<div><strong><span style=\"font-size: xx-small; \">DESCRIPCION CLIENTE:</span></strong><span style=\"font-size: xx-small; \"> %descripcionCliente</span></div>\r\n<div><span style=\"font-size: xx-small; \"> </span><em><strong><span style=\"font-size: xx-small; \">Gracias por confiar en nuestros servicios!</span></strong></em></div>\r\n<div><em><span style=\"font-size: xx-small; \">Cualquier consulta puede hacerla al 0297-4476554 o bien acceder a nuestras oficinas en Av San Martin 263 (galeria San Martin) 2do piso of 210</span></em></div>','Formulario de las Ordenes de Trabajo',NULL),(2,'impresiones','ORDEN_TRABAJO_PLANILLA','<table width=\"761\" cellspacing=\"0\" cellpadding=\"0\" border=\"1\" class=\"MsoTableGrid\" style=\"border-collapse:collapse;mso-table-layout-alt:fixed;border:none;\r\n    mso-border-alt:solid black .5pt;mso-border-themecolor:text1;mso-yfti-tbllook:\r\n    1184;mso-padding-alt:0cm 5.4pt 0cm 5.4pt\">\r\n    <tbody>\r\n        <tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes\">\r\n            <td width=\"357\" valign=\"top\" colspan=\"2\" style=\"width:267.6pt;border-top:solid windowtext 1.0pt;\r\n            border-left:solid black 1.0pt;mso-border-left-themecolor:text1;border-bottom:\r\n            none;borde