L&lt;/strong&gt;&lt;/td&gt;\r\n            &lt;td&gt;%informacionAdicional&lt;/td&gt;\r\n            &lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n            &lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n        &lt;/tr&gt;\r\n        &lt;tr&gt;\r\n            &lt;td style=&quot;text-align: right;&quot;&gt;&lt;strong&gt;ASUNTO&lt;/strong&gt;&lt;/td&gt;\r\n            &lt;td&gt;%asunto&lt;/td&gt;\r\n            &lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n            &lt;td&gt;&amp;nbsp;&lt;/td&gt;\r\n        &lt;/tr&gt;\r\n    &lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;','IMPRESION_REGISTRO',NULL),(283,'system','GENERALES_DIASNTERES','15','GENERALES_DIASNTERES',NULL),(284,'system','GENERALES_INTERESDIARIO','1','GENERALES_INTERESDIARIO',NULL),(285,'system','REDONDEO_IMPORTES','0','REDONDEO_IMPORTES',NULL),(286,'system','RESTA_MES_EXPENSAS','0','RESTA_MES_EXPENSAS',NULL),(287,'system','TEXTO_COMP_EXPENSAS','en concepto de pago de expensas','TEXTO_COMP_EXPENSAS',NULL),(288,'system','logoEmpresa','Logo Espacio Chacabuco.jpg','logoEmpresa',NULL),(289,'system','WEB_IMAGEN1','WEB_IMAGEN1','WEB_IMAGEN1',NULL),(290,'system','WEB_IMAGEN2','WEB_IMAGEN2','WEB_IMAGEN2',NULL),(291,'system','WEB_IMAGEN3','WEB_IMAGEN3','WEB_IMAGEN3',NULL),(292,'system','WEB_IMAGEN4','WEB_IMAGEN4','WEB_IMAGEN4',NULL),(293,'system','WEB_INICIO','&lt;h3&gt;Bienvenidos al sitio oficial FIORANI NEGOCIOS INMOBILIARIOS! Cualquier consulta o inquietud puede hacerlo a los tel&Atilde;&copy;fonos de contacto o bien enviando un EMAIL para su pronta respuesta.&lt;/h3&gt;','WEB_INICIO',NULL),(294,'system','WEB_CUERPOINICIO','&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;Con m&amp;aacute;s de 20 a&amp;ntilde;os de trayectoria en la realizaci&amp;oacute;n de operaciones de bienes ra&amp;iacute;ces. Nuestra empresa brinda a sus clientes el mejor asesoramiento integral necesario para concretar una exitosa operaci&amp;oacute;n inmobiliaria, con atenci&amp;oacute;n personalizada realizada con eficiencia por sus titulares y un equipo de profesionales altamente capacitados. Desarrollamos diversos negocios inmobiliarios compra venta, alquiler, administraci&amp;oacute;n de propiedades alquiladas por cuenta y orden de propietarios, administraci&amp;oacute;n de consorcios y tasaciones.&amp;nbsp;&lt;/span&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;Los principios que gu&amp;iacute;an nuestro trabajo son:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Honestidad, Integridad, Conocimiento, Compromiso y &amp;Eacute;tica en los negocios.&lt;/li&gt;\r\n	&lt;li&gt;Dinamismo, Flexibilidad y Poder de an&amp;aacute;lisis para adaptarnos a las necesidades cambiantes del mercado.&lt;/li&gt;\r\n	&lt;li&gt;Trabajo con pasi&amp;oacute;n, Eficacia, Profesionalismo y Sentido de equipo.&lt;/li&gt;\r\n	&lt;li&gt;Capacitaci&amp;oacute;n continua a nuestro equipo de trabajo.&lt;/li&gt;\r\n	&lt;li&gt;Nuestro prop&amp;oacute;sito es lograr superarnos dia a dia en la tarea de satisfacer las necesidades de nuestros clientes.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','WEB_CUERPOINICIO',NULL),(295,'system','DATOS_EMPRESA_PUNTOVENTA','2','DATOS_EMPRESA_PUNTOVENTA',NULL),(296,'system','DATOS_EMPRESA_LOCALIDAD','Comodoro Rivadavia','DATOS_EMPRESA_LOCALIDAD',NULL),(297,'system','DATOS_EMPRESA_PROVINCIA','Chubut','DATOS_EMPRESA_PROVINCIA',NULL),(298,'system','WEB_FRASEQUIENES','Quienes Somos?','WEB_FRASEQUIENES',NULL),(299,'system','WEB_CUERPOSQUIENES','&lt;h1&gt;QUIENES SOMOS?&lt;/h1&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;&lt;strong&gt;&amp;iquest;De d&amp;oacute;nde venimos? &amp;iquest;Qui&amp;eacute;nes somos? &amp;iquest;Ad&amp;oacute;nde vamos?&lt;/strong&gt;&amp;nbsp;(en&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Idioma_franc%C3%A9s&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Idioma franc&Atilde;&copy;s&quot;&gt;franc&amp;eacute;s&lt;/a&gt;&amp;nbsp;D&amp;#39;o&amp;ugrave; venons nous? Que sommes nous? O&amp;ugrave; allons nous?) es un cuadro de&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Paul_Gauguin&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Paul Gauguin&quot;&gt;Paul Gauguin&lt;/a&gt;&amp;nbsp;hecho en diciembre de 1897 durante su segunda estancia en&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Tahit%C3%AD&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Tahit&Atilde;&shy;&quot;&gt;Tahit&amp;iacute;&lt;/a&gt;. Se conserva en el&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Museo_de_Bellas_Artes_de_Boston&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Museo de Bellas Artes de Boston&quot;&gt;Museo de Bellas Artes de Boston&lt;/a&gt;.&lt;sup&gt;&lt;a href=&quot;http://es.wikipedia.org/wiki/%C2%BFDe_d%C3%B3nde_venimos%3F_%C2%BFQui%C3%A9nes_somos%3F_%C2%BFAd%C3%B3nde_vamos%3F#cite_note-1&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;&quot;&gt;1&lt;/a&gt;&lt;/sup&gt;&amp;nbsp;Se conoce por la referencia n&amp;uacute;m. 561 del&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Cat%C3%A1logo_de_Wildenstein&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Cat&Atilde;&iexcl;logo de Wildenstein&quot;&gt;cat&amp;aacute;logo de Wildenstein&lt;/a&gt;.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;Las tres preguntas son las t&amp;iacute;picas que un tahitiano, curioso y hospitalario, hace a un extra&amp;ntilde;o que se encuentra por el camino: &amp;iquest;qui&amp;eacute;n eres? (&lt;em&gt;(o vai &amp;acute;oe?&lt;/em&gt;), &amp;iquest;De d&amp;oacute;nde vienes? (&lt;em&gt;nohea roa mai &amp;acute;oe?&lt;/em&gt;), &amp;iquest;D&amp;oacute;nde vas? (&lt;em&gt;te haere &amp;acute;oe hea?&lt;/em&gt;). Seguramente a Gauguin le hab&amp;iacute;an hecho a menudo estas tres preguntas, que las transforma en la primera personal del plural y hace una alegor&amp;iacute;a de la vida.&lt;sup&gt;&lt;a href=&quot;http://es.wikipedia.org/wiki/%C2%BFDe_d%C3%B3nde_venimos%3F_%C2%BFQui%C3%A9nes_somos%3F_%C2%BFAd%C3%B3nde_vamos%3F#cite_note-2&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;&quot;&gt;2&lt;/a&gt;&lt;/sup&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;Descripci&amp;oacute;n&lt;span style=&quot;font-family:sans-serif; font-size:small&quot;&gt;&lt;span style=&quot;color:rgb(85, 85, 85)&quot;&gt;[&lt;/span&gt;&lt;a href=&quot;http://es.wikipedia.org/w/index.php?title=%C2%BFDe_d%C3%B3nde_venimos%3F_%C2%BFQui%C3%A9nes_somos%3F_%C2%BFAd%C3%B3nde_vamos%3F&amp;amp;action=edit&amp;amp;section=2&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Editar secci&Atilde;&sup3;n: Descripci&Atilde;&sup3;n&quot;&gt;editar&lt;/a&gt;&lt;span style=&quot;color:rgb(85, 85, 85)&quot;&gt;]&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;La escena es un paisaje tropical lleno de mujeres y ni&amp;ntilde;os tahitianos, cada uno de ellos en una actividad diferente y simb&amp;oacute;lica. A la derecha, un beb&amp;eacute; duerme en el suelo rodeado de tres chicas sentadas y un perro. Al fondo, se encuentran dos personajes con t&amp;uacute;nica y abrazados, caminan mientras hablan y una figura sentada en el suelo los mira en una posici&amp;oacute;n simiesca rasc&amp;aacute;ndose la cabeza. En el centro, una figura&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Andr%C3%B3gina&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Andr&Atilde;&sup3;gina&quot;&gt;andr&amp;oacute;gina&lt;/a&gt;&amp;nbsp;coge una fruta. A sus pies, un ni&amp;ntilde;o come otra fruta rodeado de gatos y una cabra. Al fondo en la izquierda hay una estatua oriental con los brazos levantados con una mujer a su lado y un embri&amp;oacute;n humano en el otro. Finalmente, a la izquierda, hay una mujer apoyada sobre su brazo, una vieja sentada en posici&amp;oacute;n fetal tap&amp;aacute;ndose la cara, y un p&amp;aacute;jaro blanco con una lagartija entre las patas.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;Gauguin lo describe de esta forma:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;blockquote&gt;\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;Los dos &amp;aacute;ngulos superiores son amarillos [...] de forma que parece un fresco doblado de los cantos y fijado sobre una pared dorada. Abajo a la derecha hay un beb&amp;eacute; dormido y tres mujeres en cuclillas. Dos figuras vestidas de p&amp;uacute;rpura se conf&amp;iacute;an sus conversaciones. Una figura enorme agachada, realizada deliberadamente a pesar de la perspectiva, levanta el brazo y mira sorprendida a los dos personajes que osan hablar sobre su destino. En el centro, hay una figura que recoge una fruta, dos gatos cerca de un ni&amp;ntilde;o, y una cabra. El &amp;iacute;dolo, con los dos brazos levantados misteriosamente y con ritmo, parece indicar el m&amp;aacute;s all&amp;aacute;. Una figura agachada parece escuchar al &amp;iacute;dolo. Y, finalmente, una vieja cerca de la muerte parece aceptar, resignada, lo que est&amp;aacute; pensando, y cierra la leyenda [...] El conjunto de la escena se sit&amp;uacute;a entre un arroyo y bajo los &amp;aacute;rboles, al fondo est&amp;aacute; el mar , y, m&amp;aacute;s all&amp;aacute;, las monta&amp;ntilde;as de la isla vecina.&lt;sup&gt;&lt;a href=&quot;http://es.wikipedia.org/wiki/%C2%BFDe_d%C3%B3nde_venimos%3F_%C2%BFQui%C3%A9nes_somos%3F_%C2%BFAd%C3%B3nde_vamos%3F#cite_note-Monfreid-3&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); white-space: nowrap; background: none;&quot;&gt;3&lt;/a&gt;&lt;/sup&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;/blockquote&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:rgb(85, 85, 85); font-family:open sans,arial,sans-serif&quot;&gt;La isla vecina es Moorea, visible desde el oeste de Tahit&amp;iacute; a pesar de que proporcionalmente se muestra como si estuviera m&amp;aacute;s cercana.&lt;/span&gt;&lt;/p&gt;\r\n','WEB_CUERPOSQUIENES',NULL),(300,'system','WEB_FRASESERVICIOS','En que nos especializamos','WEB_FRASESERVICIOS',NULL),(301,'system','WEB_CUERPOSERVICIOS','&lt;h1&gt;SERVICIOS&lt;/h1&gt;\r\n\r\n&lt;p&gt;Un&amp;nbsp;&lt;strong&gt;servicio&lt;/strong&gt;&amp;nbsp;es un conjunto de&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Actividad_econ%C3%B3mica&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Actividad econ&Atilde;&sup3;mica&quot;&gt;actividades&lt;/a&gt;&amp;nbsp;que buscan responder a las necesidades de un&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Cliente_(econom%C3%ADa)&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Cliente (econom&Atilde;&shy;a)&quot;&gt;cliente&lt;/a&gt;. Los servicios incluyen una diversidad de actividades desempe&amp;ntilde;adas por un crecido n&amp;uacute;mero de funcionarios que trabajan para el estado (&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Servicios_p%C3%BAblicos&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Servicios p&Atilde;&ordm;blicos&quot;&gt;servicios p&amp;uacute;blicos&lt;/a&gt;) o para empresas particulares (servicios privados); entre estos pueden se&amp;ntilde;alarse los servicios de:&lt;a href=&quot;http://es.wikipedia.org/wiki/Electricidad&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Electricidad&quot;&gt;electricidad&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Agua_potable&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Agua potable&quot;&gt;agua potable&lt;/a&gt;, aseo,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Tel%C3%A9fono&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Tel&Atilde;&copy;fono&quot;&gt;tel&amp;eacute;fono&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Tel%C3%A9grafo&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Tel&Atilde;&copy;grafo&quot;&gt;tel&amp;eacute;grafo&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Correo_postal&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Correo postal&quot;&gt;correo&lt;/a&gt;&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Transporte&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Transporte&quot;&gt;transporte&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Educaci%C3%B3n&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Educaci&Atilde;&sup3;n&quot;&gt;educaci&amp;oacute;n&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Cibercaf%C3%A9&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Cibercaf&Atilde;&copy;&quot;&gt;cibercaf&amp;eacute;s&lt;/a&gt;,&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Sanidad&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Sanidad&quot;&gt;sanidad&lt;/a&gt;&amp;nbsp;y&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Asistencia_social&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Asistencia social&quot;&gt;asistencia social&lt;/a&gt;. Se define un marco en donde las actividades se desarrollar&amp;aacute;n con la idea de fijar una expectativa en el resultado de &amp;eacute;stas. Es el equivalente no material de un&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Bien_econ%C3%B3mico&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Bien econ&Atilde;&sup3;mico&quot;&gt;bien&lt;/a&gt;. Un servicio se diferencia de un bien (f&amp;iacute;sico o intangible) en que el primero se consume y se desgasta de manera brutal puesto que la&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Econom%C3%ADa_social&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Econom&Atilde;&shy;a social&quot;&gt;econom&amp;iacute;a social&lt;/a&gt;&amp;nbsp;nada tiene que ver con la pol&amp;iacute;tica moderna; es muy importante se&amp;ntilde;alar que la econom&amp;iacute;a nacional no existe siempre en el momento en que es prestado.&lt;/p&gt;\r\n\r\n&lt;p&gt;Al proveer alg&amp;uacute;n nivel de&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Destreza&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Destreza&quot;&gt;habilidad&lt;/a&gt;,&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Creatividad&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Creatividad&quot;&gt;ingenio&lt;/a&gt;&amp;nbsp;y&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Experiencia&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Experiencia&quot;&gt;experiencia&lt;/a&gt;, los&amp;nbsp;&lt;a class=&quot;new&quot; href=&quot;http://es.wikipedia.org/w/index.php?title=Proveedor&amp;amp;action=edit&amp;amp;redlink=1&quot; style=&quot;text-decoration: none; color: rgb(165, 88, 88); background: none;&quot; title=&quot;Proveedor (a&Atilde;&ordm;n no redactado)&quot;&gt;proveedores&lt;/a&gt;&amp;nbsp;de un servicio participan en una econom&amp;iacute;a sin las restricciones de llevar&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Inventario&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Inventario&quot;&gt;inventario&lt;/a&gt;&amp;nbsp;pesado o preocuparse por voluminosas&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Materias_primas&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Materias primas&quot;&gt;materias primas&lt;/a&gt;. Por otro lado, requiere constante&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Inversi%C3%B3n&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Inversi&Atilde;&sup3;n&quot;&gt;inversi&amp;oacute;n&lt;/a&gt;&amp;nbsp;en mercadotecnia, capacitaciones y actualizaci&amp;oacute;n de cara a la&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Competencia_(econom%C3%ADa)&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Competencia (econom&Atilde;&shy;a)&quot;&gt;competencia&lt;/a&gt;, la cual tiene igualmente pocas restricciones f&amp;iacute;sicas.&lt;/p&gt;\r\n\r\n&lt;p&gt;Los provedores de servicios componen el&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/Sector_terciario&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Sector terciario&quot;&gt;sector terciario&lt;/a&gt;&amp;nbsp;de la&amp;nbsp;&lt;a href=&quot;http://es.wikipedia.org/wiki/Industria&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Industria&quot;&gt;industria&lt;/a&gt;.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Definici&amp;oacute;n establecida en la serie de normas ISO 9000&lt;span style=&quot;font-family:sans-serif; font-size:small&quot;&gt;&lt;span style=&quot;color:rgb(85, 85, 85)&quot;&gt;[&lt;/span&gt;&lt;a href=&quot;http://es.wikipedia.org/w/index.php?title=Servicio_(econom%C3%ADa)&amp;amp;action=edit&amp;amp;section=1&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;Editar secci&Atilde;&sup3;n: Definici&Atilde;&sup3;n establecida en la serie de normas ISO 9000&quot;&gt;editar&lt;/a&gt;&lt;span style=&quot;color:rgb(85, 85, 85)&quot;&gt;]&lt;/span&gt;&lt;/span&gt;&lt;/h2&gt;\r\n\r\n&lt;div class=&quot;VT rellink&quot; style=&quot;font-style: italic; padding-left: 1.6em; margin-bottom: 0.5em; color: rgb(37, 37, 37); font-family: sans-serif; font-size: 14px; line-height: 22.3999996185303px;&quot;&gt;&lt;span style=&quot;font-size:12px&quot;&gt;V&amp;eacute;ase tambi&amp;eacute;n:&lt;/span&gt;&amp;nbsp;&lt;a class=&quot;mw-redirect&quot; href=&quot;http://es.wikipedia.org/wiki/ISO_9000&quot; style=&quot;text-decoration: none; color: rgb(11, 0, 128); background: none;&quot; title=&quot;ISO 9000&quot;&gt;ISO 9000&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt;Un servicio que tiene como resultado de llevar a cabo necesariamente al menos veinte actividades en la interfaz entre el proveedor y el cliente y el servicio y generalmente es intangible. La prestaci&amp;oacute;n de un servicio puede implicar:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;una actividad realizada sobre un producto tangible suministrado por el cliente (por ejemplo, reparaci&amp;oacute;n de un autom&amp;oacute;vil);&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;una actividad realizada sobre un producto intangible suministrado por el cliente (por ejemplo, la declaraci&amp;oacute;n de ingresos necesaria para preparar la devoluci&amp;oacute;n de los impuestos);&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;la entrega de un producto intangible (por ejemplo, la entrega de informaci&amp;oacute;n en el contexto de la transmisi&amp;oacute;n de conocimiento);&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;la creaci&amp;oacute;n de una ambientaci&amp;oacute;n para el cliente (por ejemplo, en hoteles y restaurante).&lt;/li&gt;\r\n&lt;/ul&gt;\r\n','WEB_CUERPOSERVICIOS',NULL),(302,'system','WEB_NOMBREPLANTILLA','thinker_template','WEB_NOMBREPLANTILLA',NULL),(303,'system','WEB_NOMBRECOLOR','style','WEB_NOMBRECOLOR',NULL),(304,'system','WEB_HABILITADO','0','WEB_HABILITADO',NULL),(305,'system','SOAP_ESTADO_CUENTA','SOAP_ESTADO_CUENTA','SOAP_ESTADO_CUENTA',NULL),(306,'system','HOST_WEB_SOAP','','HOST_WEB_SOAP',NULL),(307,'system','CANTIAD_DESDE_VENC','-10','CANTIAD_DESDE_VENC',NULL),(308,'system','CANTIAD_HASTA_VENC','10','CANTIAD_HASTA_VENC',NULL),(309,'system','SIZE_EXPENSAS_FUENTE','10','SIZE_EXPENSAS_FUENTE',NULL);
/*!40000 ALTER TABLE `settings` ENABLE KEYS */;
